<p>Steven Gonzales, 67, of Phoenix, passed away December 1, 2019. Preceded in death by his father, Manuel Gonzales, survived by his mother Gloria Gonzales of Michigan, children Kalim Gonzales of China, Tahirih Amado of Tennessee, and Steven Gabriel Gonzales of Phoenix; brothers Manuel \u201CTodd\u201D Gonzales of Michigan and James Gonzales of Florida. Mr. Gonzales was a Professor of Law at the Arizona Summit Law School, a practicing attorney and a past Administrative Law Judge. He became a member of the Baha\u2019i faith in his late teens and has traveled the world. A graveside service will be held 11:00 AM, Wednesday December 11th at the Desert Rose Baha\u2019i Cemetery. 6056 S. Alai Drive, Eloy, Arizona. (obituary from <a href="https://www.jwarrenfuneral.com/obituaries/Steven-Gonzalez?obId=19707827#/obituaryInfo">J Warren Funeral Services</a>)</p>
